function Header() {
    return (
      <div className="bg-gray-200 text-white px-4 py-2 flex items-center justify-between shadow">
        {/* 왼쪽: 메뉴 아이콘 */}
        <div className="text-2xl cursor-pointer">☰</div>
  
        {/* 가운데: 버튼들 */}
        <div className="flex space-x-2">
          <button className="bg-gray-300 text-gray-800 px-3 py-1 rounded">관리자 페이지 (메인)</button>
          <button className="bg-gray-200 text-gray-800 px-3 py-1 rounded">로그인</button>
        </div>
  
        {/* 오른쪽: 보라색 버튼 */}
        <button className="bg-indigo-600 hover:bg-indigo-700 text-white px-4 py-1 rounded shadow">
          홈페이지로 이동
        </button>
      </div>
    );
  }
  
  export default Header;
